import React from "react";
import NavBar from "../components/layout/Navbar";


const Home = () => {
  return (
    <div>
      <NavBar />
      <div class="hero">
            <h1>Welcome to Our Blog</h1>
        </div>
    </div>
  );
};

export default Home;
